 this.setstate({
    value:this.state.value+1,
 })
}
function dec(){
    this.setstate({
       value:this.state.value-1,
    })
   }

const App = () => {
    return <>
        <div className="counter">
            <button className="btn btn-danger">-</button>
            <h2>The Value:{this.state.value}</h2>
            <button className="btn btn-primary" onClick={this.inc}>+</button>
        </div>
    </>;
}
